import React, { Component } from 'react';
import { youtubeData } from "./data"; 
class List extends Component {

    render() {
        createPlayList =>{
            let request = gapi.client.youtube.playlists.insert({
                part: 'snippet,status',
                resource: {
                  snippet: {
                    title: 'Test Playlist',
                    description: 'A private playlist created with the YouTube API'
                  },
                  status: {
                    privacyStatus: 'private'
                  }
                }
              });
        }
        return (
            <div className="{styles.listBox}">
                <ul>
                    <li>
                        <div className="{styles.listImg}">
                            <img src="" alt="동영상 이미지"/>
                        </div>
                        <div className="{styles.listTxt}">
                            {/* <iframe src="https://www.youtube.com/watch?v=k5fd-t3jjDw" frameborder="0"></iframe> */}
                            {/* <iframe width="880" height="495" src="https://www.youtube.com/embed/k5fd-t3jjDw" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe> */}

                        </div>
                    </li>
                </ul>
            </div>
        );
    }
}

export default List;
